import React, {Component} from 'react';
import axios from 'axios';
import { Link } from 'react-router-dom';
import {HashRouter as Router, Route} from 'react-router-dom';

class Signup extends Component {

  constructor(props){
    super(props);
    this.state = {
      name: '',
      email: '',
      password: '',
      buyerSeller: ''
    }
  }

  componentDidMount(){
    console.log('we are in chewie');
  }

  onChangeEmail = (e) => {
    this.setState({email: e.target.value})
  }
  onChangeName = (e) => {
    this.setState({name: e.target.value})
  }
  onChangePassword = (e) => {
    this.setState({password: e.target.value})
  }
  onChangeBuyerSeller = (e) => {
    this.setState({buyerSeller: e.target.value})
  }

  handleSubmit() {

  }

  render(){
    return(
      <div>
        <h3>Sign up</h3>
        <form onSubmit={this.handleSubmit}>
          <input type="text" placeholder="Name" onChange={this.onChangeName} />
          <br />
          <input type="text" placeholder="email" onChange={this.onChangeEmail} />
          <br />
          <input type="text" placeholder="password" />
          <br />
          <div className="form-group">
            <div className="form-check">
              <input className="form-check-input" type="radio" name="customerOptions" id="buyer" value = "buyer" checked={this.state.todo_priority === 'buyer'} onChange={this.onChangeTodoPriority} />
              <label className="form-check-label">Buyer</label>
            </div>
            <div className="form-check">
              <input className="form-check-input" type="radio" name="customerOptions" id="seller" value = "seller" checked={this.state.todo_priority === 'seller'} onChange={this.onChangeTodoPriority} />
              <label className="form-check-label">Seller</label>
            </div>
          </div>
          <input type="submit" />
        </form>
      </div>
    )
  }

}

export default Signup;
